script: |
  super -f text -I q12643.spq | sort > q12643.out

inputs:
  - name: q12643.spq
    data: |
      SELECT ALL col1 AS col2 FROM tab2 (FORMAT parquet) WHERE ( - col2 - col0 * - col2 ) NOT BETWEEN + ( + col0 ) * col0 AND 24 * - col2;
  - name: tab2

outputs:
  - name: q12643.out
    data: |
      51
      67
      77
